PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?instanceOf ?subclassOf ?ortholog ?taxon ?genomicStart ?genomicEnd ?strandOrientation ( GROUP_CONCAT( DISTINCT STR( ?expressedIn ) ; SEPARATOR = ", " ) AS ?expressedInList ) ?encodes ?chromosome WHERE {
  {
    SELECT ?instanceOf ?subclassOf ?ortholog ?taxon ?strandOrientation ?encodes ?chromosome ( SAMPLE( ?genomicStart ) AS ?genomicStartSample ) ( SAMPLE( ?genomicEnd ) AS ?genomicEndSample ) WHERE {
      wd:Q18032040 wdt:P31 ?instanceOf .
      wd:Q18032040 wdt:P279 ?subclassOf .
      OPTIONAL {
        wd:Q18032040 wdt:P684 ?ortholog .
      }
      wd:Q18032040 wdt:P703 ?taxon .
      OPTIONAL {
        wd:Q18032040 wdt:P644 ?genomicStart .
      }
      OPTIONAL {
        wd:Q18032040 wdt:P645 ?genomicEnd .
      }
      wd:Q18032040 wdt:P2548 ?strandOrientation .
      wd:Q18032040 wdt:P688 ?encodes .
      wd:Q18032040 wdt:P1057 ?chromosome .
    }
    GROUP BY ?instanceOf ?subclassOf ?ortholog ?taxon ?strandOrientation ?encodes ?chromosome
  }
  OPTIONAL {
    wd:Q18032040 wdt:P5572 ?expressedIn .
  }
  BIND( ?genomicStartSample AS ?genomicStart ) BIND( ?genomicEndSample AS ?genomicEnd )
}
GROUP BY ?instanceOf ?subclassOf ?ortholog ?taxon ?genomicStart ?genomicEnd ?strandOrientation ?encodes ?chromosome
LIMIT 1

